package cn.onetozero.easy.annotations.enums;/** * @author  徐卫超 * @since 2019/8/3 17:25 * 功能：用于标识在合适进行数据填充 * 备注： */public enum FillType {    /**     * 不进行填充     */    NONE,    /**     * 新增时会进行填充的字段     */    INSERT,    /**     * 修改时会进行的字段填充     */    UPDATE,    /**     * 新增或修改时候会更新     */    INSERT_UPDATE;}